import axios from "axios";

export default {
  // Gets all books
  getListings: function () {
    console.log("get listings");
    return axios.get("/api/users");
  },
  // Gets the book with the given id
  getListing: function (id) {
    return axios.get("/api/listing/" + id);
  },
  // Deletes the book with the given id
  deleteListing: function (id) {
    return axios.delete("/api/listing/" + id);
  },
  // Verify login credentials, return user ID
  checkCredentials: function (userData) {
    const info = axios.get("api/users/");

    const filterData = info.data;

    for (var i = 0; i < filterData.length; i++) {
      if (filterData.[i].email === userData.email && filterData.[i].password === userData.password) {
        return filterData.[i]._id
      }
    };
  },
  // Create login credentials in database, return new user ID
  createCredentials: function (userData) {
    return axios.push("api/users", userData);
  },



